import React from "react";
import { Link } from "react-router-dom";

class Navbar extends React.Component {
  constructor() {
    super();
    this.state = {
      match: false
    };
    this.search = this.search.bind(this);
  }
  search() {
    let input = document.getElementById("searchbar").value;
    input = input.toLowerCase().trim();

    // ignore empty strings, spaces, and strings less than 3 char in length
    if (input === " " || input === "" || input.length < 3) {
      this.setState({ match: true });
      console.log(
        "The searchbar is empty and match = " + this.state.match
      );
    } else {
      this.setState({ match: true });
      console.log(input, this.state.match);
    }
  }
  render() {
    return (
      <nav>
        {/* <!-- nav top section --> */}
        <div id="nav-top-section">
          {/* <!-- hamburger --> */}
          <div class="hamburger">
            <div class="line"></div>
            <div class="line"></div>
            <div class="line"></div>
          </div>
          {/* <!-- nav logo --> */}
          <div class="nav-logo-subsection">
            <div class="nav-by-container">
              <Link to="/">IT Blog</Link>
              <p>by Christina Punla</p>
            </div>
          </div>
          {/* <!-- right search bar --> */}
          <div class="search-subsection">
            <div class="search-container">
              <input
                id="searchbar"
                type="text"
                name="search"
                placeholder="SEARCH..."
              />
              <button id="close-button">
                <i class="fas fa-times fa-lg"></i>
              </button>
            </div>
            <button onClick={this.search} id="search-button" type="submit">
              <Link to="/Search">
                <i class="fa fa-search fa-lg"></i>
              </Link>
            </button>
          </div>
        </div>
        {/* <!-- nav bottom section --> */}
        <div id="nav-bottom-section">
          {/* <!-- nav links --> */}
          <ul class="nav-links">
            <li>
              <Link to="/OperatingSystems">OPERATING SYSTEMS</Link>
            </li>
            <li>
              <Link to="/Printers">PRINTERS</Link>
            </li>
            <li>
              <Link to="/Outlook">OUTLOOK</Link>
            </li>
            <li>
              <Link to="/Powerpoint">POWERPOINT</Link>
            </li>
            <li>
              <Link to="/ActiveDirectory">ACTIVE DIRECTORY</Link>
            </li>
            <li>
              <Link to="/Exchange">EXCHANGE</Link>
            </li>
          </ul>
          {/* <!-- mobile search button --> */}
          <button id="mobile-search-button">
            <i class="fa fa-search fa-2x"></i>
          </button>
        </div>
      </nav>
    );
  }
}

export default Navbar;
